import React, { ReactElement } from "react";
import { PageIds } from "../../stores/Interfaces";

import "./styles.scss";

const Header = (): ReactElement => {
  return (
    <header className="app-header">
      <h1>TRAIT</h1>
      <nav>
        <ul>
          {Object.values(PageIds).map((value) => (
            <li className="option">
              <a href={`#${value}`} key={value}>
                {value}
              </a>
            </li>
          ))}
        </ul>
      </nav>
    </header>
  );
};
export default Header;
